measurements.description:
One hundred flowers on 18 up to 15-cm inflorescences and seven buds on three immature inflorescences; 
 91-cm x 50-cm plant grown in 34-cm plastic pot; 

 sepals and petals lanceolate, white overlaid light mauve;

 lip tubular, white overlaid light mauve, dark purple distally; 

 column white, anther cap white;
 substance firm; texture matte; also awarded #20245280 CCE.
